           <script>
    document.addEventListener('DOMContentLoaded', function () {
        var txtStatusMessage = document.getElementById('txtStatusMessage');
        var shareButton = document.getElementById('shareButton');
        var feedsList = document.querySelector('.feeds');
        var messages = [];

        loadMessages();

        shareButton.addEventListener('click', function () {
            var message = txtStatusMessage.value.trim();

            if (message !== '') {
                var newMessage = {
                    username: 'ROBLOX',
                    content: message,
                    date: getCurrentDate()
                };

                messages.push(newMessage);

                saveMessages();
                updateFeedList();

                txtStatusMessage.value = '';
            }
        });

        function updateFeedList() {
            feedsList.innerHTML = '';

            messages.forEach(function (message) {
                var listItem = document.createElement('li');
                listItem.className = 'list-item';
                listItem.innerHTML = `
                    <a href="" class="list-header">
                        <img class="header-thumb" src="https://cdn.fossci.com/3faf0c0ddee1f7b5276e780968812d8c63881d85e575d0aae96e5b5278ae9c16.png">
                    </a>
                    <div class="list-body">
                        <p class="list-content">
                            <a href="">${message.username}</a>
                        </p>
                        <p class="feedtext linkify">${message.content}</p>
                        <span class="xsmall text-date-hint">${message.date}</span>
                        <a href="/abusereport/Feed?id=835&amp;redirectUrl=https%3A%2F%2Fwww.fossci.com%2Fhome" class="abuse-report-modal">
                            <span class="icon-report"></span>
                        </a>
                    </div>
                `;
                feedsList.appendChild(listItem);
            });
        }

        function getCurrentDate() {
            var now = new Date();
            var monthNames = ['Jan', 'Feb', 'Mar', 'Apr', 'May', 'Jun', 'Jul', 'Aug', 'Sep', 'Oct', 'Nov', 'Dec'];
            var formattedDate = `${monthNames[now.getMonth()]} ${('0' + now.getDate()).slice(-2)} ${now.getFullYear()} | ${now.toLocaleTimeString([], {hour: '2-digit', minute: '2-digit'})}`;
            return formattedDate;
        }

        function saveMessages() {
            localStorage.setItem('messages', JSON.stringify(messages));
        }

        function loadMessages() {
            var storedMessages = localStorage.getItem('messages');
            if (storedMessages) {
                messages = JSON.parse(storedMessages);
                updateFeedList();
            }
        }
    });
    
      var clearDataButton = document.getElementById('clearDataButton');
    clearDataButton.addEventListener('click', function () {
        clearLocalStorage();
        messages = [];
        updateFeedList();
    });

    function clearLocalStorage() {
        localStorage.removeItem('messages');
    }
</script>

                                       
                                       
                                       
                                       
                                       
                                       
                                       
                                       
